// LoadPlacesByPage performs eager loading of values by page. This is for a N-1 relationship.
func (s PlaceRecommendationSlice) LoadPlacesByPage(ctx context.Context, e boil.ContextExecutor, mods ...qm.QueryMod) error {
	return s.LoadPlacesByPageEx(ctx, e, DefaultPageSize, mods...)
}
func (s PlaceRecommendationSlice) LoadPlacesByPageEx(ctx context.Context, e boil.ContextExecutor, pageSize int, mods ...qm.QueryMod) error {
	if len(s) == 0 {
		return nil
	}
	for _, chunk := range chunkSlice[*PlaceRecommendation](s, pageSize) {
		if err := chunk[0].L.LoadPlace(ctx, e, false, &chunk, queryMods(mods)); err != nil {
			return err
		}
	}
	return nil
}

func (s PlaceRecommendationSlice) GetLoadedPlaces() PlaceSlice {
	result := make(PlaceSlice, 0, len(s))
	mapCheckDup := make(map[*Place]struct{})
	for _, item := range s {
		if item.R == nil || item.R.Place == nil {
			continue
		}
		if _, ok := mapCheckDup[item.R.Place]; ok {
			continue
		}
		result = append(result, item.R.Place)
		mapCheckDup[item.R.Place] = struct{}{}
	}
	return result
}

